<script>
    $(window).scroll(function() {
      var scroll = $(window).scrollTop();
      var header =  $('.my-header').scrollTop();

      if (scroll > header ) {
        $('.my-header').addClass('sticky');
      }

      if (scroll <= header ) {
        $('.my-header').removeClass('sticky');        
      }
    });

    $('li').click(function(){
       $("li.active").removeClass('active');
       $(this).addClass('active');
    })
</script>
